import Nav from '../components/nav'
import Content from '../components/content'
const Home = () => {

  useEffect(() => {
    // Update the document title using the browser API
    document.getElementsByTagName('body'[0].style.backgroundColor = "#D5483F")
  });

  return(
    <div>
      <Nav/>
      <Content/>

    </div>
  )

}
export default Home
